import React from "react";
import logo from "./assets/doctor.png";
const Header = () => {
  return (
    <div className="navbar">
      <p>
        <span>
          <img src={logo} height={"30vh"} width={50} />
        </span>
        MedAI
      </p>
      <p>
        Medicine Recommendation System leveraging Knowledge Graphs & Large
        Language Models
      </p>
    </div>
  );
};

export default Header;
